import {useSelector} from "react-redux";
import { Link } from "react-router-dom";
const Cart = () => {
  const {cart}= useSelector((state)=>state);
  return (<div>
      {
        cart.length > 0 ?
        (<h1>return</h1>):
        (
          <div>
            <h1>Your Cart is Empty </h1>
            <Link to="/">
              <button>Shop Now</button>
            </Link>
          </div>
        )
      }
  </div>);
};

export default Cart;
